import Link from 'next/link'
const Nav = () => (
    <div>
        <ul>
        <li><Link href='/'><a>Home</a></Link></li>
        <li><Link href='/about'><a>About</a></Link></li>
        </ul>
<style jsx>{`
    ul{
        background: #333;
        color: #fff;
        display: flex;
        list style: none
    }
    ul li{
        font-size: 18px;
        margin-right: 20px;
    }

    ul li a{
        color: #fff;
        text-decoration: none;
    }
`}</style>
    </div>
)

export default Nav;
